import React from 'react'
import ReactDOM from 'react-dom'
import {createEffect, createStore, createEvent, forward} from 'effector'
import {useStore, useList} from 'effector-react'

const portalMounted = createEvent()
const portalUnmounted = createEvent()

const $portals = createStore({})
  .on(portalMounted, (store, {name, children}) =>
    Object.assign(store, {[name]: children})
  )
  .on(portalUnmounted, (store, {name}) => {
    const newStore = {...store}
    delete newStore[name]
    return newStore
  })

function PortalOut({name}) {
  return useStoreMap({
    store: $portals,
    keys: [name],
    fn: (portals, [name]) => portals[name] || null,
  })
}

const PortalIn = createGate()
const prevPortalIn = PortalIn.state.map(console.log)

sample({
  source: PortalIn.state,
  clock: PortalIn.open,
  target: portalMounted,
})

sample({
  source: PortalIn.state,
  clock: PortalIn.close,
  target: portalUnmounted,
})

//portalMounted.watch(console.log)
//portalUnmounted.watch(console.log)

function Child() {
  const [show, setShow] = React.useState(false)
  return (
    <>
      <button onClick={() => setShow(!show)}>display div</button>
      {show ? 'show' : 'hide' }
      {show && (
        <PortalIn name="out">
          <div>hi man</div>
        </PortalIn>
      )}
    </>
  )
}
function App() {
  return (
    <>
      <Child />
      <PortalOut name="out" />
    </>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))

